import React from "react";
import "./App.css";
import male from "./photos/Mars_symbol.svg.png";
import card from "./card";
function App() {
  return (
    <React.Fragment>
      <div className="App">
        <h2>I am a ..</h2>

        <div className="col-md-4">
          <div className="card text-center"></div>
          <div className="overflow">
            <img src={male} />
          </div>
          <div className="card-body text-dark">
            <h4 className="card-title">Male</h4>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default App;
